            <div id="notice-box" class="notice__section">
                <h2 class="notice__title">
                    <span class="notice__title__text">▼年度末は中古車の買取価格が高い！▼</span>
                </h2>
                <div class="notice__title__description">
                    <p><p><span style="color: rgb(224, 62, 45);"><strong>3月は1年のうちで中古車が最も高く売れる時期です。</strong></span>3月になると企業の決算準備や期の変わりに伴う引越しなどの移動が増加していき、自動車の流通が活発になっていきます。<br><span style="color: rgb(224, 62, 45);"><strong>そのため、少しでも高い売却を狙うには3月の売却が非常にお勧めです。<br></strong></span></p></p>
