                    <p>運営元であるカレント自動車では、創業時から一貫して二重査定を行なっておりません。</p><p>もし事故などが後から見つかってもお客様へ一切責任転嫁いたしません。</p><p><br></p><h3 class="" style="text-align: center;">即日振込できる理由とお約束</h3><p>【弊社の場合】</p><p>故障や事故歴等を正確に見極められる技術があり、自社で修理修復ができるため、万が一、契約後に瑕疵が見つかってもお客様に転嫁いたしません。</p><p class="" style="text-align: center;">↓</p><p class="" style="text-align: center;">即日振込ができる！</p><p>【他社の場合】</p><p>故障や事故歴等を見極められる技術がなく、契約後に見つかった場合、キャンセルや減額になるケースがあるため、即日振込はリスクがあります。</p><p class="" style="text-align: center;">↓</p><p class="" style="text-align: center;">即日振込ができない</p><h3 class="" style="text-align: center;">お客様にご協力いただく条件はたった2つ！</h3><p><strong>①車検があり自走可能な状態で、出張査定当日にご契約いただきその場でお車をお譲りいただけること</strong></p><p><strong>②名義変更の書類がすべて揃った状態で、ご契約当日にお渡しいただけること</strong></p><p><br></p><p>※契約金額の全額を入金いたします。</p><p>※即日振込サービスのご利用にあたって特別な手続き等はございません。</p><p><br></p><p><br></p>
