                <div class="c_inner02" style="margin-top: 1rem;">
                    <p><span style="font-size: 14px;">カレント自動車株式会社（以下「当社」といいます）は、当社が取り扱う全ての個人情報の保護について、社会的使命を十分に認識し、本人の権利の保護、個人情報に関する法規制等を遵守します。また、最新のIT技術の動向、社会的要請の変化、経営環境の変動等を常に認識しながら、個人情報セキュリティ体制の継続的改善に、全社を挙げて取り組むことをお約束します。 </p>
                    <ol>
                        <li data-tadv-p="keep"><span style="font-size: 14px;">個人情報は、当社提供サービスにおける当社の正当な事業遂行上並びに従業員の雇用、人事管理上必要な範囲に限定して、取得・利用及び提供をし、特定された利用目的の達成に必要な範囲を超えた個人情報の取扱い（目的外利用）を行いません。また、目的外利用を行わないための措置を講じます。</span>
                        </li>
                        <li data-tadv-p="keep"><span style="font-size: 14px;">個人情報保護に関する法令、国が定める指針及びその他の規範を遵守いたします。</span></li>
                        <li data-tadv-p="keep"><span
                                style="font-size: 14px;">個人情報の漏えい、滅失、き損などのリスクに対しては、合理的な安全対策を講じて防止すべく事業の実情に合った経営資源を注入し個人情報セキュリティ体制を継続的に向上させます。また、個人情報保護上、問題があると判断された場合には速やかに是正措置を講じます。
                            </span></li>
                        <li data-tadv-p="keep"><span style="font-size: 14px;">個人情報取扱いに関する苦情及び相談に対しては、迅速かつ誠実に、適切な対応をさせていただきます。</span></li>
                        <li data-tadv-p="keep"><span style="font-size: 14px;">個人情報セキュリティ体制は、当社を取り巻く環境の変化を踏まえ、適時・適切に見直してその改善を継続的に推進します。</span></li>
