                            <h3 class="styled_h4"><strong>個人情報の取扱いについて</strong></h3>
                        </dl>
                    </div>
                    <h4>1.個人情報の定義</h4>
                    <p>生存する個人に関する情報であって、次の各号のいずれかに該当するものをいいます。</p>
                    <ol>
                        <li>
                            当該情報に含まれる氏名、生年月日その他の記述等により特定の個人を識別することができるもの（他の情報と容易に照合することができ、それにより特定の個人を識別することができることとなるものを含みます。）
                        </li>
                        <li>個人識別符号が含まれるもの</li>
                    </ol>
                    <h4>2.個人情報の取得・利用・提供等</h4>
                    <ol>
                        <li>当社に対する個人情報のご提供は任意としております。ご提供頂けない場合、利用目的に関連する業務に支障を来し、ご利用者様が当社のサービスを適切な形で受けられない場合がございます。</li>
                        <li>当社が個人情報を取得する際は、法令の定める場合を除き、その利用目的をできる限り明確に特定し、その目的達成に必要な限度において適法かつ公正な手段で取得します。個人情報の取得方法は当社が運営するウェブサイトでの画面入力や文書のご提出等を原則としております。
                        </li>
                        <li>個人情報を利用する際は、本人に明示、通知、又は公表した利用目的の範囲内に限定し、それに反する目的外利用を行なわないための措置を講じます。また、特定の個人を識別することができないように加工した匿名加工情報についても法令を遵守し、安全管理について適切な措置を講じる等適正に取り扱います。
                        </li>
                        <li>個人情報を第三者に提供又はその取扱いを委託する際は、本人が同意を与えた利用目的の範囲内で、適法にこれを行います。</li>
                    </ol>
                    <h4>3.保有個人データの利用目的</h4>
                    <p>当社は、提供された個人情報を以下の目的で利用します。</p>
                    <ul>
                        <li>当社サービスの提供、維持、改善及び保護のため</li>
                        <li>当社サービスに関する登録・変更の受付、本人確認、利用料金・代金の請求等のため</li>
                        <li>当社サービスに付帯するアフターサービス、お問合せ対応のため</li>
                        <li>当社サービスに関する不正利用防止や安全性確保のため
                        </li>
                        <li>当社の商品・サービスに関するお知らせ・ご案内・PRのため
                        </li>
                        <li>当社の商品・サービスに関する調査・データ集積・分析、研究開発、新商品・サービスの開発のため</li>
                        <li>当社サービス上で第三者から提供されるコンテンツや広告をお客様にとって利便性の高いものとするための、登録情報や利用状況の分析のため</li>
                        <li>広告の配信状況の把握、広告効果の測定、及び行動ターゲティング広告の表示のため</li>
                        <li>当社または第三者の広告の配信または表示のため
                        </li>
                        <li>キャンペーン等の実施及びお客様に賞品等を発送するため</li>
                        <li>従業者の雇用・人事管理のため <br>*採用活動におけるプライバシーポリシーは <a href="https://www.currentmotor.co.jp/recruit-privacy/" target="_blank">こちら</a> をご確認ください</li>
                        <li>保有個人データの安全管理のために講じた措置</li>
                    </ul>
                    <p>上記の利用目的の範囲内において、業務委託等により当社以外の第三者に個人情報の取り扱いを委託することがあります。そうした場合には、十分な個人情報保護の水準を備える者を選定し、契約等によって個人情報の保護水準を守るよう定め、個人情報を適切に取り扱います。<br>
                        なお、当社が提供する商品及びサービスに関するお客様からのご要望、お問い合わせ・苦情等に対するご回答等を行うために利用させていただくことがございます。ご回答は原則としてお客様ご本人にのみ行いますが、法人等のお客様の場合、同一法人内の社員様等にご回答することがございます。
                    </p>
                    <h4>4.保有個人データの第三者提供</h4>
                    <p>当社は、当社が取り扱う個人情報のうち個人データを、以下のような法令に定める場合を除いて、本人の同意なく第三者に提供しないものとします。 
                    </p>
                    <ol>
                        <li>国の機関もしくは地方公共団体又はその委託を受けた者が法令の定める事務を遂行することに対して、当社が協力する必要があり、かつ同意取得が当該事務の遂行に支障を及ぼすおそれがある場合</li>
                        <li>その他法令で認められる場合
                        </li>
                    </ol>
                    <h4>5.Secure Socket Layerについて</h4>
                    <p>
                        当社のウェブサイトはSecure Socket Layer（SSL）に対応しており、ウェブブラウザとウェブサーバーとの通信を暗号化しています。ユーザーが入力する氏名や住所、電話番号、クレジットカード番号等の個人情報は自動的に暗号化されます。
                    </p>

                    <h4>6.クッキーについて</h4>
                    <p>クッキー（Cookie）とは、ご利用者様がウェブサイトを利用したときに、インターネット閲覧ソフト（ブラウザ）とサーバーとの間で送受信した利用履歴や入力内容等を、ご利用者様のコンピュータにファイルとして保存しておく仕組みです。
                        当社は、ウェブサイトの機能性向上や広告の配信、トラフィックの解析、セキュリティ強化などの目的でクッキーを利用します。</p>
                    <p>クッキーを使用することにより、お客様により良いウェブサイト体験を提供し、より効果的なサービスを提供するための情報を収集します。お客様は、ブラウザの設定を変更することでクッキーの使用を管理することができますが、クッキーの無効化によりウェブサイトの一部の機能が制限される可能性があります。</p>
                    <h4>7.外部送信規律</h4>
                    <p>当社は、各サービスの提供にあたり、ご利用者様の端末に保存された情報を外部サーバーに送信するクッキー、コード又はプログラム等（以下「情報収集モジュール等」と総称します）を利用します。当社が利用する情報収集モジュール等の詳細は、以下の通りです。 </p>
                    <p>他社モジュール及び提供事業者</p>
                    <ul>
                        <li>Google 広告：<a href="https://policies.google.com/technologies/ads?hl=ja" target="_blank">Google LLC</a> </li>
                        <li>Yahoo!/LINE広告：<a href="https://www.lycorp.co.jp/ja/company/privacypolicy/" target="_blank">LINEヤフー株式会社 LY Corporation</a> </li>
                        <li>Facebook 広告：<a href="https://www.facebook.com/privacy/policy/?entry_point=data_policy_redirect&entry=0" target="_blank">Meta Platforms, Inc
                        </a> </li>
                        <li>Microsoft広告：<a href="https://privacy.microsoft.com/ja-jp/privacystatement" target="_blank">Microsoft Corporation
                        </a> </li>
                    </ul>
                    <p>また、当社は本サービスの向上、改良等及びお客様の興味・関心等に合わせた広告の配信や広告効果測定の精度向上等の目的で、Google拡張コンバージョンを利用します。当該サービスを利用する際に、ハッシュ化したメールアドレス・電話番号等を提供します。
                    </p><br>
                    <p>なお、当該サービスを提供する第三者事業者名、当該サービスの説明ページ・利用規約・プライバシーポリシー・オプトアウト方法、当該事業者への情報の提供内容及び当該情報の利用目的は<a href="https://support.google.com/adspolicy/answer/9755941?hl=ja&ref_topic=7012636&sjid=12980100444976368503-AP" target="_blank">こちら</a> よりご確認ください。

                    </p>
                    <h4>8.外的環境の把握について
                    </h4>
                    <p>個人データを取り扱う国における個人情報の保護に関する制度を把握した上で安全管理措置を実施しています。
                    </p>
                    <h4>9.個人情報の開示、訂正及び利用停止等</h4>
                    <p>当社は、お客様から個人情報保護法の定めに基づき個人情報の開示を求められた場合には、以下の場合を除き、お客様ご本人からの請求であることを確認のうえで、遅滞なく個人情報の開示を行います。 </p>
                    <ul>
                        <li>お客様または第三者の生命、身体、財産などの権利利益を害するおそれがある場合</li>
                        <li>当社の業務の適正な実施に著しい支障を及ぼすおそれがある場合
                        </li>
                        <li>法令に違反することとなる場合
                        </li>
                        <li>お客様ご本人からの請求であることが確認できない場合</li>
                        <li>その他当社が開示の義務を負わない場合</li>
                    </ul>
                    <div class="well2"><strong>保有個人データの取扱いに関する開示及び苦情の申し出先<br />
                    </strong></p>
                    <p>個人情報保護方針に関するお問合せにつきましては、<span style="text-decoration: none;"><a href="https://www.currentmotor.co.jp/contact/">こちら</a></span>よりお申し出ください。 
                    </p>
