                        神奈川県横浜市港北区新横浜2-5-11<br>
                        *ご来訪はお受けいたしかねますので、予めご了承ください。
                        </p>
                </div>
                    <h4>10.保有個人データ又は第三者提供記録の開示等の求めに応じる手続き</h4>
                    <ol>
                        <li>開示等の求めの申し出先 <br>
                            開示等のお求めは、当社ホームページのお問合せにてにお申し出ください。<br>
                            ※電磁的手続きによる開示等をご希望の方は、その旨お申し出ください。原則としてご希望に沿って対応させていただきます。
                        </li>
                        <li>開示等の求めに関するお手続き <br>
                            <ol>
                                <li>お申し出受付け後、当社からご利用いただく所定の請求書様式「保有個人データ開示等請求書」を郵送いたします。</li>
                                <li>ご記入いただいた請求書、代理人によるお求めの場合は代理人であることを確認する書類、手数料分の郵便為替（利用目的の通知並びに開示の請求の場合のみ）を上記個人情報問合せ窓口までご郵送ください。</li>
                                <li>上記請求書を受領後、ご本人確認のため、当社に登録していただいている個人情報のうちご本人確認可能な2項目程度（例：電話番号と生年月日等）の情報をお問合せさせていただきます。
                                </li>
                                <li>回答は原則としてご本人に対して書面（封書郵送）にておこないます。
                                </li>
                            </ol>
                        </li>
                        <li>代理人によるお求めの場合、代理人であることを確認する資料 <br>
                            開示等をお求めになる方が代理人様である場合は、代理人である事を証明する資料及び代理人様ご自身を証明する資料を同封してください。各資料に含まれる本籍地情報は都道府県までとし、それ以降の情報は黒塗り等の処理をしてください。また各資料は個人番号を含まないものをお送りいただくか、全桁を墨塗り等の処理をしてください。 <br>
