                                    <span style="margin-left: 1rem">その他法定代理権の確認ができる公的書類</span><br>
                                    ＜代理人様が成年被後見人の法定代理人の場合＞いずれかの写し<br>
                                    <span style="margin-left: 1rem">後見登記等に関する登記事項証明書 </span><br>
                                    <span style="margin-left: 1rem">その他法定代理権の確認ができる公的書類</span><br>
                                </li>
                                <li>
                                    代理人様ご自身を証明する資料 <br>
                                    <span style="margin-left: 1rem">運転免許証</span><br>
                                    <span style="margin-left: 1rem">パスポート</span><br>
                                    <span style="margin-left: 1rem">健康保険の被保険者証</span><br>
                                    <span style="margin-left: 1rem">（被保険者等記号・番号等は全桁を墨塗りしてご提出ください）</span><br>
                                    <span style="margin-left: 1rem">住民票</span>
                                </li>
                            </ol>
                        </li>
                        <li>利用目的の通知または開示のお求めについての手数料 <br>
                            1回のお求めにつき1,000円 <br>
                            （書面でのご請求の場合は、お送りいただく請求書等に郵便為替を同封していただきます。その他の方法でご請求いただく場合は、ご請求時にご相談させていただきます。）<br>
                            なお、利用停止または消去の場合は、手数料は不要です。<br>
                        </li>
                    </ol>
                    <h4>11.保有個人データの安全管理のために講じた措置</h4>
                    <ol>
                        <li>基本方針の策定 <br>
                            保有個人データの適正な取扱いの確保のため、「関係法令・ガイドライン等の遵守」、「質問及び苦情処理の窓口」等について「個人情報保護方針」を策定しています。
                        </li>
                        <li>保有個人データの取扱いに係る規律の整備 <br>
                            保有個人データは取得、利用、保存、提供、削除・廃棄等の段階ごとに、取扱方法、責任者・担当者及びその任務等について個人情報保護規程を策定しています。</li>
                        <li>組織的安全管理措置 <br>
                            <ol>
                                <li>保有個人データの取扱いに関する責任者を設置するとともに、保有個人データを取り扱う従業者及び当該従業者が取り扱う保有個人データの範囲を明確化し、法や取扱規程に違反している事実又は兆候を把握した場合の責任者への報告連絡体制を整備しています。</li>
                                <li>保有個人データの取扱状況について、定期的に自己点検を実施するとともに、他部署や外部の者による監査を実施しています。</li>
                            </ol>
                        </li>
                        <li>人的安全管理措置 <br>
                        <ol>
                            <li>保有個人データの取扱いに関する留意事項について、従業者に定期的な研修を実施しています。</li>
                            <li>保有個人データを含む秘密保持に関する誓約書の提出を全従業者から受けています。</li>
                        </ol>
                        </li>
                        <li>物理的安全管理措置 <br>
                            <ol>
                                <li>保有個人データを取り扱う区域において、従業者の入退室管理及び持ち込む機器等の制限を行うとともに、権限を有しない者による保有個人データの閲覧を防止する措置を講じています。
                                </li>
                                <li>保有個人データを取り扱う機器、電子媒体及び書類等の盗難又は紛失等を防止するための措置を講じるとともに、事業所内の移動を含め、当該機器、電子媒体等を持ち運ぶ場合、容易に保有個人データが判明しないよう措置を講じています。</li>
                            </ol>
                        </li>
                        <li>技術的安全管理措置 <br>
                            <ol>
                                <li>アクセス制御を実施して、担当者及び取り扱う個人情報データベース等の範囲を限定しています。
                                </li>
                                <li>保有個人データを取り扱う情報システムを外部からの不正アクセス又は不正ソフトウェアから保護する仕組みを導入しています。</li>
                            </ol>
                        </li>
                    </ol>
                    <h4>12.本プライバシーポリシーの改定</h4>
                    <p>
                        当社は、本プライバシーポリシーを改定することがあります。変更する場合には、変更後の本プライバシーポリシーの施行時期及び内容を当社のウェブサイト上での表示など、適切な方法により周知します。 

                    </p>
