</section>    <section class="c-qa" id="qa">
    <div class="c-qa__inner">
      <h2 class="headline01">
        <span>旧車・クラシックカー</span>の<br>
        売却査定・買取に関するQ&amp;A
      </h2>

              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>査定や手続きにかかわる費用は無料ですか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. もちろん無料です！旧車王の査定は、すべて無料で承ります。名義変更やその他の手続きにかかる費用も一切いただいておりません。
          </p>
        </details>
              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>地方在住なのですが大丈夫ですか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. 問題ありません！旧車王は、北海道から沖縄まで離島も含め、無料でどこでも出張査定いたします。
          </p>
        </details>
              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>購入時のローンが残っていますが買取可能ですか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. 買取可能です。クレジット会社への確認や残債一括清算など、お気軽にご相談ください。ただし、買取金額よりローンの残債が大きい場合は、その差額分を支払っていただく場合があります。
          </p>
        </details>
              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>車検が切れていても買取可能ですか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. 買取可能ですので、ご安心してお問い合わせください。
          </p>
        </details>
              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>振込はいつ行われますか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. 車輌の引上げの確認と必要書類をお預かりし、社内ですべて確認がとれた日の翌々営業日にご入金いたします。また条件が当てはまる方は、最短で当日でのご入金が可能です。詳しくはお問い合わせください
          </p>
        </details>
              <details class="c-qa__item">
          <summary>
            <h3 class="c-qa__item__title">
              <span>どんなクルマでも買取可能ですか？</span>
            </h3>
          </summary>
          <p class="c-qa__item__body">
            A. 10年以上古い車をメインとした旧車に特化した事業をしているため、新しいお車では当社の強みを生かすことができず、ご満足頂けるご提案ができないと考えております。何卒ご了承くださいませ。
          </p>
        </details>
          </div>
  </section>
